INSERT INTO `ti_question` VALUES (106, 'A', NULL, NULL, 107, NULL, '坐标系', '如图，某飞行器在4千米高空水平飞行，从距着陆点的水平距离10千米处下降， 已知下降飞行轨迹为某三次函数图像的一部分，则函数的解析式为（&nbsp;&nbsp; ）ABCD', '<div class=\"que-stem\" style=\"margin: 0px; padding: 0px; font-size: 16px; color: rgb(51, 51, 51); font-family: 微软雅黑, &quot;Hiragino Sans GB&quot;, arial, helvetica, clean;\"><div class=\"questem-inner bdjson\" style=\"margin: 0px; padding: 0px;\"><p class=\"ext_text-align_left\" style=\"margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; line-height: 1.5;\"><span style=\"vertical-align: middle;\">如图，某飞行器在4千米高空水平飞行，从距着陆点</span><img width=\"16px\" height=\"17px\" class=\"scale-img\" src=\"https://gss0.baidu.com/7LsWdDW5_xN3otqbppnN2DJv/baidu/pic/item/0824ab18972bd4078284c05c7f899e510eb309cb.jpg\" style=\"margin: 14px 0px; max-width: 640px;\"><span style=\"vertical-align: middle;\">的水平距离10千米处下降， 已知下降飞行轨迹为某三次函数图像的一部分，则函数的解析式为（&nbsp;&nbsp; ）</span></p><p class=\"ext_text-align_left\" style=\"margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; line-height: 1.5;\"><img width=\"267px\" height=\"128px\" class=\"scale-img\" src=\"https://gss0.baidu.com/7LsWdDW5_xN3otqbppnN2DJv/baidu/pic/item/0ff41bd5ad6eddc4fcbea75a3ddbb6fd52663331.jpg\" style=\"margin: 14px 0px; max-width: 640px;\"></p></div></div><div class=\"que-options\" style=\"margin: 20px 0px 0px; padding: 0px; font-size: 16px; color: rgb(130, 131, 134); line-height: 1.5; font-family: 微软雅黑, &quot;Hiragino Sans GB&quot;, arial, helvetica, clean;\"><div class=\"queoptions-inner bdjson clearfix\" style=\"margin: 0px; padding: 0px;\"><div class=\"opt-item\" style=\"margin: 0px; padding: 0px 20px 0px 0px; display: inline-block; float: left; height: 69px; line-height: 69px;\"><p style=\"margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; line-height: 1.5; display: inline-block;\"><span class=\"prefix\" style=\"vertical-align: middle; padding-right: 10px;\">A</span><img width=\"105px\" height=\"41px\" class=\"scale-img\" src=\"https://g